import React, {Component} from 'react';

import './App.css';
import Articles from './Components/Articles';
import Nav from './Components/Nav';

class App extends Component {
	render() {
		return (
			<div className="App">
				<Nav />

				<Articles />
			</div>
		);
	}
}

export default App;
